import { Button, ButtonGroup } from "react-bootstrap";

const Menus = () => {
  return (
    <>
      <ButtonGroup className="float-right menus">
        <Button className="mx-1">Start again</Button>
        <Button className="mx-1">Configure new Game</Button>
      </ButtonGroup>
    </>
  );
};

export default Menus;
